import React from 'react';
import axios from 'axios';

function App(){
    React.useEffect(function(){
        const res = axios.get('http://localhost:8800/users');
        console.log(res);
    },[])

    return(
        <div>
            <h1>Hello React !</h1>
            <p>Testing the axios API</p>
        </div>
    )
}
export default App;
